import React, { Component } from 'react';
import { Butt  } from '../components/Butt';
import AnsI from '../components/AnsI';

export default class AnsL extends Component {
  render() {
  	const {ansIs} = this.props;
  	return (
	  <ul className="list-group">	    	
	  	{ansIs.map(ansI => {
	  		return <AnsI key={ansI.id} ansW={ansI.ansW} />;
	  	})}
	  <Butt className="btn-upper" type="button"> 
			Clear Answers 
	  </Butt>	
	  </ul>
    );
  }	

}
